t.put('/Admin/Modules/Shared/Js/UIComponents/EntityAccess/AddEntityAccessRule.html','<cms-modal-dialog-container cms-modal-size="large">    <cms-modal-dialog-header>        Add Access Rule    </cms-modal-dialog-header>    <cms-form cms-name="mainForm" ng-submit="onAdd()">        <cms-page-actions>            <cms-button cms-text="Add" ng-click="onAdd()" class="main-cta" ng-disabled="mainForm.$invalid || saveLoadState.isLoading"></cms-button>            <cms-button cms-text="Cancel" ng-click="onCancel()"></cms-button>        </cms-page-actions>        <cms-page-body cms-content-type="form">            <cms-form-status></cms-form-status>            <cms-form-section cms-title="Permit Access To">                <cms-form-field-dropdown cms-title="User Area"                    cms-options="userAreas"                    cms-option-name="name"                    cms-option-value="userAreaCode"                    cms-model="command.userAreaCode"                    cms-description="The user area to restrict access to."                    cms-change="onUserAreaChanged()"                    required></cms-form-field-dropdown>                <cms-form-field-filtered-dropdown cms-title="Role"                        cms-search-function="searchRoles($query)"                        cms-option-name="title"                        cms-option-value="roleId"                        cms-model="command.roleId"                        cms-description="Optionally you can restrict access to a specific role within the user area."                        ></cms-form-field-dropdown>            </cms-form-section>        </cms-page-body>    </cms-form></cms-modal-dialog-container>');
t.put('/Admin/Modules/Shared/Js/UIComponents/EntityAccess/EntityAccessEditor.html','<cms-modal-dialog-container cms-modal-size="large">    <cms-modal-dialog-header>        {{::entityDefinitionName}} Access: {{::entityDescription}}    </cms-modal-dialog-header>    <cms-form cms-name="mainForm"        cms-edit-mode="editMode"        ng-submit="save()"        cms-loading="formLoadState.isLoading">        <cms-page-actions ng-show="!editMode">            <cms-button cms-text="Ok"                ng-click="close()"                ng-disabled="globalLoadState.isLoading" class="main-cta"></cms-button>        </cms-page-actions>        <!-- Edit mode toolbar -->        <cms-page-actions ng-show="editMode">            <cms-button-submit cms-text="Save"                cms-loading="saveLoadState.isLoading"                ng-disabled="mainForm.$invalid || globalLoadState.isLoading"></cms-button-submit>            <cms-button cms-text="Cancel"                ng-click="close()"                ng-disabled="globalLoadState.isLoading"></cms-button>        </cms-page-actions>        <cms-page-body>            <cms-form-status></cms-form-status>            <cms-form-section cms-title="Inherited Rules"                 ng-if="inheritedRules.length"                cms-loading="formLoadState.isLoading">                <cms-form-field-container>                     <p>                        These rules are inherited from parent directories. Users will need to meet the rule requirements for each                        parent directory in order to gain access.                    </p>                </cms-form-field-container>                <cms-form-field-container>                    <cms-table-container>                        <table>                            <thead>                                <tr>                                    <th>Directory</th>                                    <th>User Area</th>                                    <th>Role</th>                                    <th>Redirect to Sign-in</th>                                    <th>Default Action</th>                                </tr>                            </thead>                            <tbody>                                <tr ng-repeat="rule in inheritedRules">                                    <td><a href="{{urlLibrary.directoryDetails(rule.accessRuleSet.pageDirectory.pageDirectoryId)}}" target="_blank">{{rule.accessRuleSet.pageDirectory.fullUrlPath}}</a></td>                                    <td>{{rule.userArea.name}}</td>                                    <td>{{rule.role.title}}</td>                                    <td title="{{rule.accessRuleSet.signInRedirectDescription}}">{{rule.accessRuleSet.signInRedirect}}</td>                                    <td title="{{rule.accessRuleSet.violationAction.description}}">{{rule.accessRuleSet.violationAction.name}}</td>                                </tr>                            </tbody>                        </table>                    </cms-table-container>                </cms-form-field-container>            </cms-form-section>            <cms-form-section cms-title="Access Rules">                                                     <cms-form-field-container>                     <p>To be granted access to this {{entityDefinitionNameLower}} users will need to meet the requirements of at least one of these rules.</p>                </cms-form-field-container>                <cms-form-field-container cms-loading="formLoadState.isLoading">                    <cms-table-container>                        <table>                            <thead>                                <tr>                                    <th>User Area</th>                                    <th>Role</th>                                    <th cms-table-column-actions                                        ng-if="canManage">Actions</th>                                </tr>                            </thead>                            <tbody>                                <tr ng-if="accessRuleSet.accessRules.length == 0">                                    <td colspan="100" class="empty">No rules found.</td>                                </tr>                                <tr ng-repeat="rule in accessRuleSet.accessRules">                                    <td>{{rule.userArea.name}}</td>                                    <td>{{rule.role.title}}</td>                                    <td cms-table-column-actions                                        ng-if="canManage">                                        <cms-button-icon cms-title="Delete"                                            cms-icon="trash-o"                                            ng-click="deleteRule(rule, $index)"                                            ng-disabled="globalLoadState.isLoading">                                        </cms-button-icon>                                    </td>                                </tr>                            </tbody>                        </table>                        <cms-table-actions>                            <a href="" class="btn-icon" title="Add"                                cms-icon="plus-circle"                                ng-click="add()"                                ng-if="canManage"                                ng-disabled="globalLoadState.isLoading">                                <i class="fa fa-plus-circle"></i>                            </a>                        </cms-table-actions>                    </cms-table-container>                </cms-form-field-container>            </cms-form-section>            <cms-form-section cms-title="Violation Action" ng-show="userAreasInRules.length">                <cms-form-field-container>                     <p>These options describe what should happen if the user is denied access.</p>                </cms-form-field-container>                <cms-form-field-checkbox cms-title="Redirect to sign-in"                    cms-model="command.redirectToSignIn"                    cms-description="Selecting this option will redirect the user to the sign-in page if they are not logged in. If they are logged in but not authorized to view the page then the default action will be triggered."                ></cms-form-field-checkbox>                <cms-form-field-dropdown cms-title="Redirect to sign-in for area"                    cms-options="userAreasInRules"                    cms-option-name="name"                    cms-option-value="userAreaCode"                    cms-model="command.userAreaCodeForSignInRedirect"                    cms-description="If the user is not signed-in in, then they will be redirected to the sign-in page for the selected user area."                    ng-if="command.redirectToSignIn && userAreasInRules.length > 1"                    required></cms-form-field-dropdown>                <cms-form-field-dropdown cms-title="Default Action"                    cms-options="violationActions"                    cms-option-name="description"                    cms-option-value="id"                    cms-model="command.violationAction"                    cms-description="The action to take when the a user is not authorized to view the page. Using an \'Error\' action tells the user that the page was found but could not be accessed, whereas a \'Not Found\' action will make the page appear not to exist for unauthorized users."                    required></cms-form-field-dropdown>            </cms-form-section>        </cms-page-body></cms-modal-dialog-container>');
